(1, 23, 'This is about page', 'video-bg_1691221095.jpg', '<div class=\"sec-title\" style=\"margin: 0px 0px 34px; padding: 0px; border: none; outline: none; position: relative; color: rgb(130, 128, 128); font-family: BalooTamma2-Medium, Arial; font-size: 16px;\"><h3 style=\"text-align: center; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: none; outline: none; font-size: 1.75rem; position: relative; color: rgb(20, 43, 60); transition: all 500ms ease 0s;\"><span style=\"margin: 0px; padding: 0px; border: none; outline: none; font-weight: bolder;\">OUR TALENT IS FINDING YOURS</span></h3></div><div class=\"inner\" style=\"margin: 0px 0px 30px; padding: 0px 0px 0px 70px; border: none; outline: none; position: relative; color: rgb(130, 128, 128); font-family: BalooTamma2-Medium, Arial; font-size: 16px;\"><div class=\"icon\" style=\"text-align: justify; margin: 0px; padding: 0px; border: none; outline: none; position: absolute; left: 0px; top: 6px;\"><img src=\"http://localhost/overseas/public/assets/images/icons/icon-4.png\" alt=\"wellup overseas\" style=\"margin: 0px; padding: 0px; border: none; outline: none; display: inline-block; max-width: 100%; height: auto; transition: all 0.7s ease-in-out 0.1s;\"></div><h6 style=\"text-align: justify; margin-right: 0px; margin-bottom: 2px; margin-left: 0px; padding: 0px; border: none; outline: none; font-weight: 800; line-height: 24px; font-size: 16px; position: relative; color: rgb(43, 168, 224); transition: all 500ms ease 0s; text-transform: uppercase;\">BANGLADESH BASED</h6><h5 style=\"text-align: justify; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: none; outline: none; font-size: 1.25rem; position: relative; color: rgb(20, 43, 60); transition: all 500ms ease 0s;\">GOVT. APPROVED AGENCY. RL NO. : 2083</h5></div><div class=\"text-justify mb-5\" style=\"margin-top: 0px; margin-right: 0px; margin-left: 0px; padding: 0px; border: none; outline: none; color: rgb(130, 128, 128); font-family: BalooTamma2-Medium, Arial; font-size: 16px; text-align: justify !important;\"><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: none; outline: none; position: relative; color: rgb(128, 128, 128); transition: all 500ms ease 0s;\">Well-up Overseas is one of the leading government-approved Recruiting Agency in Bangladesh with License No. RL-2083. Registered under the Ministry of Expatriatesâ€™ Welfare &amp; Overseas Employment which facilitates professionally managed outflow of workforce from Bangladesh to overseas destinations. Bangladesh Human Capital is also a member of the Bangladesh Association of International Recruiting Agencies (BAIRA).</p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: none; outline: none; position: relative; color: rgb(128, 128, 128); transition: all 500ms ease 0s;\"><br></p><h3 style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; color: rgb(20, 43, 60); font-size: 1.75rem; text-align: center; padding: 0px; border: none; outline: none; position: relative; transition: all 500ms ease 0s;\"><span style=\"margin: 0px; padding: 0px; border: none; outline: none; font-weight: bolder;\">OUR VISSION</span></h3><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: none; outline: none; position: relative; color: rgb(128, 128, 128); transition: all 500ms ease 0s;\"><br></p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: none; outline: none; position: relative; color: rgb(128, 128, 128); transition: all 500ms ease 0s;\">WELL-UP Recruitment Agency aspires to be the most trusted global recruitment partner. In order to improve performance and create\r\nprogressive transformation in management, companies need to hire knowledgeable and well-trained professionals. We endeavor to be the\r\nplatform through which clients can acquire their suitable match and candidates can pursue their careers with their ideal organization. To ensure\r\nthe satisfaction of both parties, we work in close collaboration with diverse industries so that staffing needs are consistently met.\r\nWith a qualified team of consultants, our goal is to provide excellent service to our customers who belong to the national and international\r\narena. By providing exceptional customer service and competitive pricing, we believe that we have the ability to identify the right applicant and\r\nplace them in an establishment that will further enhance their skill. We desire to be the best in the industry by helping the employer and\r\nemployees achieve success through our recruitment.<br></p><h3 style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; color: rgb(20, 43, 60); font-size: 1.75rem; text-align: center; padding: 0px; border: none; outline: none; position: relative; transition: all 500ms ease 0s;\"><span style=\"margin: 0px; padding: 0px; border: none; outline: none; font-weight: bolder;\">OUR MISSION</span></h3><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: none; outline: none; position: relative; color: rgb(128, 128, 128); transition: all 500ms ease 0s;\"><br></p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: none; outline: none; position: relative; color: rgb(128, 128, 128); transition: all 500ms ease 0s;\">Our mission is to be the most reliable and trustworthy global recruitment partner to both our clients and candidates. By developing resilient\r\nrelations with various business entities and studying their corporate culture, we apply the executive search process that outlines a candidateâ€™s\r\nrole in the organization. To fulfill our commitment, we integrate comprehensive recruitment service strategies which are embedded in our\r\nbusiness principles. Our approach is to invest time and effort in enhancing the skills of the workforce and use our existing databases as a source\r\nto find valuable candidates. By fulfilling a number of projects for various multinational companies, we have garnered appreciation from the\r\nindustry. Through our advertising and selection process, administrative and support services, post-selection synchronization, reference checks, and manpower outsourcing activities of selected candidates, we have placed some of the brightest professionals in a variety of positions for the\r\nfirmâ€™s longevity.<br></p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: none; outline: none; position: relative; color: rgb(128, 128, 128); transition: all 500ms ease 0s;\"><br></p><h3 style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; color: rgb(20, 43, 60); font-size: 1.75rem; text-align: center; padding: 0px; border: none; outline: none; position: relative; transition: all 500ms ease 0s;\"><span style=\"margin: 0px; padding: 0px; border: none; outline: none; font-weight: bolder;\">WHO WE ARE</span></h3><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: none; outline: none; position: relative; color: rgb(128, 128, 128); transition: all 500ms ease 0s;\"><br></p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: none; outline: none; position: relative; color: rgb(128, 128, 128); transition: all 500ms ease 0s;\">Well-up Recruitment is a boutique recruitment firm that specializes in matching the right talent to the right job. We are a preferred\r\nRecruitment Partner as we have the knack of finding the well-up for your missing puzzle in your organization. We work on exclusive\r\nassignments as we are a Preferred Recruitment Business Partner for our clients. We understand that Talent drives your business strategy and\r\nwe make it our business to find that Talent.&nbsp;</p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: none; outline: none; position: relative; color: rgb(128, 128, 128); transition: all 500ms ease 0s;\"><br></p><h3 style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; color: rgb(20, 43, 60); font-size: 1.75rem; text-align: center; padding: 0px; border: none; outline: none; position: relative; transition: all 500ms ease 0s;\"><span style=\"margin: 0px; padding: 0px; border: none; outline: none; font-weight: bolder;\">OUR FLEXIBILITY MAKES US DIFFERENT</span></h3><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: none; outline: none; position: relative; color: rgb(128, 128, 128); transition: all 500ms ease 0s;\"><br></p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: none; outline: none; position: relative; color: rgb(128, 128, 128); transition: all 500ms ease 0s;\">A shortlist of candidates within two weeks (depending on the volume of the requirements): Interviewed and pre-qualified Shortlisted\r\nCandidates meet a minimum of 8 points out of 10 points as follows the Well-Up CV form. The shortlisted candidates will be available for a face to face\r\nor webcam/phone interviews. Once selected, the candidates will be available for a maximum period of 30-60 days The candidates will complete\r\nthe medical examinations, police clearances, and passport application/renewal (if any) within a maximum period of six weeks Upon receipt of the\r\naccreditation/registration documents (if they are in compliance to the format prescribed by Well-Up), Well-Up will complete the registration of\r\nthe Clients at the Bangladesh Overseas Employment Administration within 2-3 working days. Upon receipt of the working visas and assuming\r\nthat the Employer is already registered at the Vietnam Overseas Employment Administration, Well-Up will complete the Bangladesh Overseas\r\nEmployment Administration processing of the selected candidates within 3-5 working days after which, flight reservations can be made for the\r\ncandidates</p></div>', 1, '2023-02-07 19:13:34', '2023-08-05 08:12:56', NULL);
